import React from 'react';
import { Button } from 'antd';

const Board = () => (
  <div style={{ width: '1000px', margin: '0 auto' }}>
    <Button style={{ marginTop: 15 }} htmlType="submit">글쓰기</Button>
  </div>
);

export default Board;
